function CreateUsers() {
  const options = {
    method: "POST",
    headers: {
      "content-type": "<application/json",
    },
  };
  function send() {
    fetch("http://localhost:4000/addUser ")
      .then((res) => res.json())
      .then((data) => {});
  }
  return (
    <div>
      <h1>createUsers</h1>
      <button onClick={send}>Send</button>
    </div>
  );
}

export default CreateUsers;
